import mongoose from 'mongoose';

const OrderSchema = new mongoose.Schema(
  {
    user: {
      type: mongoose.Types.ObjectId,
      ref: 'Users',
    },
    orderDetails: [
      {
        food: {
          type: mongoose.Types.ObjectId,
          ref: 'Foods',
        },
        quantity: { type: Number, required: true },
        paymode: { type: String, required: true },
        status: { type: String, default: 'Placed' },
