const ReviewsSchema = new mongoose.Schema(
  {
    food: {
      type: mongoose.Types.ObjectId,
      ref: "Foods",
    },
    restaurant: {
      type: mongoose.Types.ObjectId,
      ref: "Restaurants",
    },
    user: {
      type: mongoose.Types.ObjectId,
      ref: "Users",
    },
    rating: { type: Number, required: true },
    reviewType: { type: String, required: true },
    photos: [
      {
        type: mongoose.Types.ObjectId,
        ref: "Images",
      },
    ],
  },
  {
    timestamps: true,
  }
);

export const reviewModel = mongoose.model("Reviews", ReviewsSchema);

